import * as React from 'react';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import { Container } from '@mui/material';

export default class ImageWindow extends React.Component{
    constructor(props){
        super(props)
        this.images = props.images;
        console.log(this.images)
    }
    render(){
        return(
            <Container maxWidth='lg' fixed>
                <Box width={'100%'} height={450}
                    sx={{backgroundColor: 'secondary.main',
                        borderRadius: 5,
                        border: 2,
                        borderStyle: 'dashed'
                    }}>
                    <h5>output image preview will be shown here after uploading.</h5>
                </Box>
            </Container>
        )
        return(
            <Grid container spacing={2}>
                <Grid item xs={6}>
                    <Box sx={{width: 475, height: 400, backgroundColor: 'secondary.main' }} position='relative'>
                    </Box>
                </Grid>
                <Grid item xs={6}>
                    <Box sx={{width: 475, height: 400, backgroundColor: 'secondary.main'}} position='relative'></Box>
                </Grid>
            </Grid>
        )
    }
}
